export default function Courses() {
  return (
    <>
    <div>
      <h1 id="start">Courses We offer :</h1>
      <ul>
        <li>Full Stack Java</li>
        <li>Artificial intelligence</li>
        <li>JavaScript</li>
        <li>Web Designing</li>
        <li>Data Science</li>
      </ul>
    </div>
    </>
  );
}
